var title_f8_44_8896="The string wrap technique";
var content_f8_44_8896=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F69794&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F69794&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    String wrap method of ring removal",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 307px; height: 263px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The success of this technique depends upon tight, close wrapping of the digit or penis. Do not attempt this technique if the patient has ischemia of the digit or penis or an open wound, fracture, or dislocation distal to the ring. After appropriate analgesia, place one end of a 2.0 or 3.0 suture, Penrose drain, or umbilical tape 20 to 25 inches (0.5 to 0.6 m) in length under the ring from the proximal to the distal side with 5 inches (12.5 cm) of material remaining proximally. Wrap the suture material, drain, or tape tightly around the digit or penis beginning at the distal aspect of the ring. Overlap the wrappings so that no tissue is visible. Continue wrapping beyond the proximal interphalangeal joint of the digit or beyond the coronal sulcus of the penis. Once the wrapping is complete, pull on the proximal end of the wrapping material so that the ring is removed from the finger or penis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Fuchs SM. Ring removal. In: Textbook of Pediatric Emergency Procedures, 2nd ed, King C, Henretig FM (Eds), Lippincott Williams &amp; Wilkins, Philadelphia 2008. Copyright &copy; 2008 Lippincott Williams &amp; Wilkins.",
"    </div>",
"    <div class=\"contractual\">",
"     <br/>",
"     <a href=\"file://www.lww.com\">",
"      file://www.lww.com",
"     </a>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
