"  <div class=\"figure\" style=\"width: 609px\">",
"   <div class=\"ttl\">",
"    Tubular carcinoma of the breast",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 589px; height: 238px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (Panel A) Low power view of a tubular breast carcinoma shows that the tumor is composed of well formed glands or tubules that invade the mammary stroma.",
"    <br/>",
"    (Panel B) High power view demonstrates that the tubules are composed of columnar cells with relatively uniform nuclei. Many of the cells show \"snouts\" of eosinophilic cytoplasm at their lumenal ends.",
